import React, { Component } from "react";
import './App.css';
import Home from './Components/Home';


import { BrowserRouter as Router, Route, Switch, Link, Redirect } from "react-router-dom";


class App extends Component {
    render() {
        return <Router>

            <Route path="/" />

        </Router>
    }
}
export default App;




